import React from "react";
import "./HomePage1.css"; // still keep your styles

function HomePage1() {
  return (
    <div
      className="container"
      style={{
        background: `linear-gradient(rgba(29, 90, 140, 0.7), rgba(29, 90, 140, 0.7)), url("/arn.jpg") center/cover no-repeat`
      }}
    >
      {/* Navigation Bar */}
      <nav className="nav">
        <div className="logoSection">
          {/* Two logos side by side */}
          <div className="logo">
            <img src="/Sevauk logo.jpg" alt="Sevauk Logo" />
          </div>
          <div className="logo">
            <img src="/logo22.jpg" alt="Arunodaya Logo" />
          </div>

          {/* Gradient Title */}
          <span className="title">ARUNODAYA</span>
        </div>

        <div className="navLinks">
          <a href="/">Home</a>
          <a href="/contact">Events</a>
          <button className="loginBtn">Donate Us</button>
        </div>
      </nav>

      {/* Page content */}
      <div className="contentCenter">
        <div className="slogan">
          <span>
            BEHIND EVERY STEP OUR CHILDREN TAKE THERE ARE HANDS THAT HOLD,
            HEARTS THAT CARE,
          </span>
          <br />
          <span>AND WHO BELIEVE IN THEIR POTENTIAL.</span>
        </div>
        <button className="enrollBtn">Contact Us</button>
      </div>

      {/* Floating Donate Button */}
      <button className="donateSticky">Donate Us</button>
    </div>
  );
}

export default HomePage1;
